import React from 'react'
import './Backdrop.css'

const backdrop = ReactDOM.createPortal(document.getElementById('backdrop'))

export default function Backdrop(props) {
  return (
    <div className={`backdrop, ${props.className}`}>
      {props.children}
    </div>
  )
}
